import { useRef } from 'react'; 
import { Link } from 'react-router-dom'; 
import 'bootstrap/dist/css/bootstrap.min.css'; 
import classes from './PatientRegistrationForm.module.css'; 
import Container from 'react-bootstrap/Container'; 
import Row from 'react-bootstrap/Row'; 
import Col from 'react-bootstrap/Col'; 
// import styles from './LoginForm.module.css'; 

function PatientRegistrationForm (props)
{
    const usernameInputRef = useRef (); 
    const passwordInputRef = useRef (); 

    function SubmitHandler (event)
    {
        event.preventDefault (); 

        const enteredEmail = usernameInputRef.current.value; 
        const enteredPassword = passwordInputRef.current.value; 

        const loginData = 
        {
            email: enteredEmail, 
            password: enteredPassword
        }; 

        props.OnRegister (loginData); 
    }

    return <div>
    <Container>
    <form className={classes.form} onSubmit={SubmitHandler}>

<Row className="justify-content-md-center" fluid="md">
    {/* <label htmlFor='username'>Email</label> */}
    <input type="email" placeholder = "Email" required id="username" ref={usernameInputRef} />
</Row>


<Row className="justify-content-md-center" fluid="md">
    {/* <label htmlFor='username'>Email</label> */}
    <input type="text" placeholder = "Location" required id="location" ref={usernameInputRef} />
</Row>

<Row className="justify-content-md-center" fluid="md">
    {/* <label htmlFor='username'>Email</label> */}
    <input type="text" placeholder = "Birthdate" required id="birthdate" ref={usernameInputRef} />
</Row>

<Row className="justify-content-md-center" fluid="md">
    {/* <label htmlFor='username'>Email</label> */}
    {/* <input type="text" placeholder = "Gender" required id="gender" ref={usernameInputRef} /> */}
    <select id="gender" name="Gender">
        <option value="Male">Male</option>
        <option value="Female">Female</option>
        <option value="Other">Other</option>
    </select>
</Row>



<Row className="justify-content-md-center">
       {/* <label htmlFor='password'>Password</label> */}
       <input type="password" placeholder = "Password" required id="password" ref={passwordInputRef} />
</Row>

<Row className="justify-content-md-center">
    <Col xs lg="2" id={classes.logincolumn}>    
    <button>Login</button>
</Col>
</Row>

</form>
</Container>
    <br />
    <p>Don't have an account?</p>
    <Link to="/signup">Signup</Link>
</div>; 
}

export default PatientRegistrationForm; 
